import { Config } from '../../src/configue';

export default function() {
  const idUser = localStorage.getItem('idUser');
  const Role = localStorage.getItem('Role');
  var pages = [
    {
      title: 'agTEK',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/main'
    },

    {
      title: 'Vaches & Groupes ',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/Vaches'
    },
    {
      title: 'Regime & Fooder',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/regime'
    },
    {
      title: 'DAC',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/DAC'
    },

    {
      title: 'Statistique',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/Statistique'
    },
    {
      title: 'Log',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/Log'
    },
    {
      title: 'User',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/User'
    },
    {
      title: 'Errors',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/errors'
    }
  ];
  var UserPages = [
    {
      title: 'Profile',
      htmlBefore: '<i class="material-icons"></i>',
      to: '/Profile'
    }
  ];
  if (Role === 0) {
    for (let i = 0; i < UserPages.length; i++) {
      pages.push(UserPages[i]);
    }
  }
  pages.push(UserPages[0]);
  return pages;
}
